func (sync *Sync) SetAllRefs(rd map[string]map[string][]interface{}) {
	sync.AllRefs = make(map[string][]string)
	for _, syncType := range []string{"ntp", "ptp"} {
		syncTypeLabel := fmt.Sprintf(
			"%s%s",
			strings.ToUpper(
				string(syncType[0]),
			),
			syncType[1:],
		)
		sync.AllRefs[syncTypeLabel] = []string{}
		m := map[string]bool{}
		for _, set := range rd {
			for _, syncRef := range set[syncType] {
				ref := fmt.Sprintf("%s", syncRef)
				if _, ok := m[ref]; !ok {
					sync.AllRefs[syncTypeLabel] = append(sync.AllRefs[syncTypeLabel], ref)
					m[ref] = true
				}
			}
		}
	}
}

